import React, { Component } from 'react';
import GameInfoBlock from './gameInfoblock/GameInfoBlock';

class GameInfo extends Component {
    render() {
        return (
            <div>
                <GameInfoBlock gameInfo={ this.props.location.state.gameName}/>
            </div>
        );
    }
}

export default GameInfo;
